{
	"title": "Sub Script 1",
	"text": "#!ipxe

menu Choose Script
item subscript Fedora 29
choose --default subscript --timeout 3000 subscript && goto ${subscript}

:subscript
dhcp
set base http://dl.fedoraproject.org/pub/fedora/linux/releases/29/Server/x86_64/os
kernel ${base}/images/pxeboot/vmlinuz initrd=initrd.img repo=${base}
initrd ${base}/images/pxeboot/initrd.img
boot"
}

{
	"title": "Script 1",
	"text": "#!ipxe

menu Choose Sub Script
item fedora29_default Fedora 29 Default
choose --default fedora29_default --timeout 3000 fedora29_default && goto ${fedora29_default}

:fedora29_default
dhcp
set base http://dl.fedoraproject.org/pub/fedora/linux/releases/29/Server/x86_64/os
kernel ${base}/images/pxeboot/vmlinuz initrd=initrd.img repo=${base}
initrd ${base}/images/pxeboot/initrd.img
boot"
}
